import React from "react";
import {Header} from "./Componentes/Header";
import {ProductosLista} from "./Componentes/Productos/index";
import 'boxicons';
<box-icon name='menu' animation='tada' color='rgba(8,11,109,0.81)' ></box-icon>

function App() {
  return (
    <div className="App">
      <Header/>
      <ProductosLista/>
    </div>
  );
}

export default App;
